/**
 * Provide a variable as an argument. It will return true if the variable
 * is not object like, more specifically not an array or object. Null will
 * return true.
 * @param variable
 */
export declare function isNotObjectLike(variable: any): boolean;
/**
 * Provide a variable as an argument. It will return true if the variable
 * is not an object. If the variable is null or an array, it will return true.
 * @param variable
 */
export declare function isNotObject(variable: any): boolean;
/**
 * Provide a variable as an argument. It will return true if the variable
 * is not a string.
 * @param variable
 */
export declare function isNotString(variable: any): boolean;
/**
 * Provide a variable as an argument. It will return true if the variable
 * is not a string with length
 * @param variable
 */
export declare function isNotStringWithLength(variable: any): boolean;
export declare function isNotFunction(variable: any): boolean;
export declare function isNotBoolean(variable: any): boolean;
export declare function isNotNumber(variable: any): boolean;
export declare function isNotArray(variable: any): boolean;
export declare function isNotUndefined(variable: any): boolean;
export declare function isNotNull(variable: any): boolean;
export declare function isNotNill(variable: any): boolean;
export declare function isNotBigInt(variable: any): boolean;
export declare function isNotSymbol(variable: any): boolean;
